CREATE TABLE igazgatosag (
  id int NOT NULL,
  nev varchar(40) NOT NULL,
  kozpont varchar(11) NOT NULL,
  CONSTRAINT pk_igazgatosag 
    PRIMARY KEY (id)
);

CREATE TABLE vizmerce (
  id int NOT NULL,
  varos varchar(9) NOT NULL,
  igId int NOT NULL,
  folyKm float NOT NULL,
  ksz1 int NOT NULL,
  ksz2 int NOT NULL,
  ksz3 int NOT NULL,
  lkv int NOT NULL,
  lnv int NOT NULL,
  nullPont float NOT NULL,
  CONSTRAINT pk_vizmerce 
    PRIMARY KEY (id),
  CONSTRAINT fk_igazgatosag
    FOREIGN KEY (igId) REFERENCES igazgatosag(id)
);

CREATE TABLE meres (
  id int NOT NULL,
  vmId int NOT NULL,
  nap date NOT NULL,
  ido time NOT NULL,
  vizAllas int NOT NULL,
  CONSTRAINT pk_vizallas 
    PRIMARY KEY (id),
  CONSTRAINT fk_vizmerce  
    FOREIGN KEY (vmId) REFERENCES vizmerce(id)
);



